import React from 'react';
import { BrowserRouter as Router, Routes, Route, RouterProvider, createBrowserRouter, createRoutesFromElements } from 'react-router-dom';
import Register from './Resources/register';
import FirstPage from './Resources/starting';
import { Acc as Account} from './Resources/account';
import './App.css';

const router = createBrowserRouter( createRoutesFromElements(
  <Route path='/' element={ <FirstPage/> }>
    <Route path='/register' element={ <Register /> } />
    <Route path='/account' element={ <Account /> } />
  </Route>
));

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FirstPage />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
}

export default App;
